import React from 'react';
import img from './img/logo 1.png'
import "./css/nav.css"
import $ from "jquery";
import { NavLink } from 'react-router-dom';


const Nav =()=>{

    $(document).ready(function(){

        $('#logoani1').mousemove(function(evt){
        
            var x=evt.pageX;
            var y=evt.pageY;
            var wy=50;
            $('#logoani').css({ "transform" : "rotateX("+(wy-y+10)+"deg) rotateY("+($(window).width()-x)+"deg)"});
        })
        
        $('#logoani1').mouseleave(function(evt){
            $('#logoani').css({ "transform" : "rotateX(0deg) rotateY(0deg)"});
        
        })
    });
        

    return(
        <div className="navbar">
            <ul className="navlist">
             <li className="li1"> <NavLink to='/services'>Services</NavLink></li>
             <li className="li1">Technology</li>
                <li>
                    <div className="logo1" id="logoani1">
                        <div className="logo12" id="logoani">
                            <img src={img} alt="logo img"
                                className="mainlogo"/>
                        </div>
                    </div>
                </li>
                 <li className="li1">Contact Us</li>
            <li className="li1">About</li>
            </ul>
        </div>
    )


}

export default Nav;
